import React, { Component } from 'react'
import { Fragment } from 'react'
import { BrowserRouter as Router, Route, Link, NavLink } from 'react-router-dom';

class LoginForm extends Component {
    render() {
        return (
            <Fragment>
                {/* LEFT SIDE OF THE PAGE */}
                <div className='appAside'>

                </div>

                {/* RIGHT SIDE OF THE PAGE */}
                <div className='appForm'>
                    {/* DIV FOR THE TOGGLE BUTTONS ON TOP OF PAGE */}
                    <div className='pageSwitch'>
                        <a href='#' className='toggleSwitchActive'> Sign In</a>
                        <a href='#' className='toggleSwitch'> Sign Up</a>
                    </div>
                    {/* START OF THE FORM */}
                    <div className='login100-form'>
                        <form>

                            <input className='input100' type='text' id='username' name='username' placeholder='Username'></input>
                            <input className='input100' type='password' id='password' name='password' placeholder='Password'></input>
                            <button className='ogin100-form-btn' type='submit'>Login</button>
                        </form>
                    </div>

                </div>
            </Fragment>
        )
    }
}

export default LoginForm
